import { BiArchive } from "react-icons/bi";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          <BiArchive /> Edit <code>src/App.js</code> and save to reload.
        </p>
      </header>
    </div>
  );
}

export default App;
